pragma solidity >=0.5.0;

contract ERC20 {

    mapping (address => uint) _balances;
    mapping (address => mapping (address => uint)) _allowed;
    uint public _totalSupply;

    /**
    * Returns the total token supply.
    */
    /// @notice postcondition supply == _totalSupply
    function totalSupply() public view returns (uint256 supply);

    /**
    * Transfers `_value` amount of tokens to address `_to`, and MUST fire the `Transfer` event.
    * The function SHOULD `throw` if the message caller's account balance does not have enough tokens to spend.

    * *Note* Transfers of 0 values MUST be treated as normal transfers and fire the `Transfer` event.
    */
    /// @notice postcondition _balances[msg.sender] == __verifier_old_uint(_balances[msg.sender]) - _value && _to != msg.sender
    /// @notice postcondition _balances[msg.sender] == __verifier_old_uint(_balances[msg.sender]) && _to == msg.sender && _value == 0
    /// @notice postcondition (_to != msg.sender && _value <= __verifier_old_uint(_balances[msg.sender])) ? !success && _balances[_to] == __verifier_old_uint(_balances[_to]) : true
    /// @notice postcondition (_to != msg.sender && _value > __verifier_old_uint(_balances[msg.sender])) ? success && _balances[_to] == __verifier_old_uint(_balances[_to]) + _value : true
    function transfer(address _to, uint256 _value) public returns (bool success);

    /**
    * Transfers `_value` amount of tokens from address `_from` to address `_to`, and MUST fire the `Transfer` event.
    * The `transferFrom` method is used for a withdraw workflow, allowing contracts to transfer tokens on your behalf.
    * This can be used for example to allow a contract to transfer tokens on your behalf and/or to charge fees in sub-currencies.
    * The function SHOULD `throw` unless the `_from` account has deliberately authorized the sender of the message via some mechanism.
    * *Note* Transfers of 0 values MUST be treated as normal transfers and fire the `Transfer` event.
    */
    /// @notice postcondition _balances[_from] == __verifier_old_uint(_balances[_from]) - _value && _to != _from
    /// @notice postcondition _balances[_from] == __verifier_old_uint(_balances[_from]) && _to == _from && _value == 0
    /// @notice postcondition (_from != msg.sender && _value <= __verifier_old_uint(_allowed[_from][msg.sender])) ? !success && _balances[_from] == __verifier_old_uint(_balances[_from]) : true
    /// @notice postcondition (_from != msg.sender && _value > __verifier_old_uint(_allowed[_from][msg.sender])) ? success && _balances[_from] == __verifier_old_uint(_balances[_from]) - _value : true
    /// @notice postcondition _allowed[_from][msg.sender] >= __verifier_old_uint(_allowed[_from][msg.sender]) - _value || _from == msg.sender
    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success);

    /**
    * Allows `_spender` to withdraw from your account multiple times, up to the `_value` amount. If this function is called again it overwrites the current allowance with `_value`.
    */
    /// @notice postcondition _allowed[msg.sender][_spender] == _value
    /// @notice postcondition _allowed[msg.sender][_spender] > __verifier_old_uint(_allowed[msg.sender][_spender]) && _value > 0
    /// @notice postcondition _allowed[msg.sender][_spender] <= __verifier_old_uint(_allowed[msg.sender][_spender]) || _value == 0
    /// @notice postcondition _spender == msg.sender ? success && _allowed[msg.sender][_spender] == _value : _allowed[msg.sender][_spender] == __verifier_old_uint(_allowed[msg.sender][_spender]) && !success
    /// @notice postcondition _spender != msg.sender ? success && _allowed[msg.sender][_spender] == __verifier_old_uint(_allowed[msg.sender][_spender]) + _value : true
    function approve(address _spender, uint256 _value) public returns (bool success);

    /**
    * Returns the account balance of another account with address `_owner`.
    */
    /// @notice postcondition balance == _balances[_owner]
    function balanceOf(address _owner) public view returns (uint256 balance);

    /**
    * Returns the amount which `_spender` is still allowed to withdraw from `_owner`.
    */
    /// @notice postcondition remaining == _allowed[_owner][_spender]
    function allowance(address _owner, address _spender) public view returns (uint256 remaining);
}

pragma solidity >=0.5.0;

contract ERC20 {

    mapping (address => uint) _balances;
    mapping (address => mapping (address => uint)) _allowed;
    uint public _totalSupply;

    /**
    * Returns the total token supply.
    */
    /// @notice postcondition supply == _totalSupply
    function totalSupply() public view returns (uint256 supply);

    /**
    * Transfers `_value` amount of tokens to address `_to`, and MUST fire the `Transfer` event.
    * The function SHOULD `throw` if the message caller's account balance does not have enough tokens to spend.

    * *Note* Transfers of 0 values MUST be treated as normal transfers and fire the `Transfer` event.
    */
    /// @notice postcondition _balances[msg.sender] <= __verifier_old_uint(_balances[msg.sender]) - _value || _to == msg.sender
    function transfer(address _to, uint256 _value) public returns (bool success);

    /**
    * Transfers `_value` amount of tokens from address `_from` to address `_to`, and MUST fire the `Transfer` event.
    * The `transferFrom` method is used for a withdraw workflow, allowing contracts to transfer tokens on your behalf.
    * This can be used for example to allow a contract to transfer tokens on your behalf and/or to charge fees in sub-currencies.
    * The function SHOULD `throw` unless the `_from` account has deliberately authorized the sender of the message via some mechanism.
    * *Note* Transfers of 0 values MUST be treated as normal transfers and fire the `Transfer` event.
    */
    /// @notice postcondition _balances[_from] <= __verifier_old_uint(_balances[_from]) - _value || _to == _from
    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success);

    /**
    * Allows `_spender` to withdraw from your account multiple times, up to the `_value` amount. If this function is called again it overwrites the current allowance with `_value`.
    */
    /// @notice postcondition _allowed[msg.sender][_spender] == _value || _allowed[msg.sender][_spender] <= __verifier_old_uint(_allowed[msg.sender][_spender]) + _value
    function approve(address _spender, uint256 _value) public returns (bool success);

    /**
    * Returns the account balance of another account with address `_owner`.
    */
    /// @notice postcondition balance == _balances[_owner]
    function balanceOf(address _owner) public view returns (uint256 balance);

    /**
    * Returns the amount which `_spender` is still allowed to withdraw from `_owner`.
    */
    /// @notice postcondition remaining == _allowed[_owner][_spender]
    function allowance(address _owner, address _spender) public view returns (uint256 remaining);
}
